query:
fragment PageInfoFragment on PageInfo {
  endCursor
  hasNextPage
  hasPreviousPage
  startCursor
  __typename
}

fragment VoucherFragment on Voucher {
  id
  code
  startDate
  endDate
  usageLimit
  discountValueType
  discountValue
  countries {
    code
    country
    __typename
  }
  minSpent {
    currency
    amount
    __typename
  }
  minCheckoutItemsQuantity
  __typename
}

query VoucherList($after: String, $before: String, $first: Int, $last: Int, $filter: VoucherFilterInput, $sort: VoucherSortingInput) {
  vouchers(after: $after, before: $before, first: $first, last: $last, filter: $filter, sortBy: $sort) {
    edges {
      node {
        ...VoucherFragment
        __typename
      }
      __typename
    }
    pageInfo {
      ...PageInfoFragment
      __typename
    }
    __typename
  }
}
